function countTriplets(arr, r) {
  const numbers = {}
  const pairs = {}
  let count = 0
  let number
  while (number = arr.pop()) {
    const nextPower = number * r
    if (pairs[nextPower]) {
      count += pairs[nextPower]
    }
    if (numbers[nextPower]) {
      pairs[number] = (pairs[number] || 0) + numbers[nextPower]
    }
    numbers[number] = (numbers[number] || 0) + 1
  }
  return count
}

function countTripletsStraightForwardVersion(arr, r) {
  const numbers = new Set()
  let pow = 0
  let number = r ** pow
  while (number <= 10e9) {
    numbers.add(number)
    pow++
    number = r ** pow
  }
  const stats = {}
  const powersOfR = arr.filter(number => numbers.has(number))
  powersOfR.forEach((number, i) => {
    stats[number] = stats[number] || []
    stats[number].push(i)
  })
  let count = 0
  powersOfR.forEach((number, i) => {
    const powPlus1 = number * r
    const powPlus2 = powPlus1 * r
    if (stats[powPlus1] === undefined || stats[powPlus2] === undefined) {
      return
    }

    // V2
    const startIdx = find1stGtIdx(stats[powPlus1], i)
    for (let j = startIdx; j < stats[powPlus1].length; j++) {
      const idxPow1 = stats[powPlus1][j]
      const firstGreaterIdx = find1stGtIdx(stats[powPlus2], idxPow1)
      if (firstGreaterIdx !== -1) {
        count += stats[powPlus2].length - firstGreaterIdx
      }
    }

    // V1
    // const powPlus1Idxs = stats[powPlus1].filter(idx => idx > i)
    // powPlus1Idxs.forEach((idxPow1) => {
    //   // count += stats[powPlus2].filter(idx => idx > idxPow1).length
    //   const firstGreaterIdx = find1stGtIdx(stats[powPlus2], idxPow1)
    //   if (firstGreaterIdx !== -1) {
    //     count += stats[powPlus2].length - firstGreaterIdx
    //   }
    // })
  })
  return count
}

function find1stGtIdx(arr, min, startIdx = 0, endIdx = arr.length - 1) {
  // const cacheKey = `${min}-${startIdx}-${endIdx}`;
  // if (!memo.has(arr)) {
  //   console.log('+1 memo')
  //   memo.set(arr, new Map())
  // }
  // const arrMemo = memo.get(arr)
  // if (arrMemo.has(cacheKey)) {
  //   cacheHit++
  //   console.log(cacheHit);
  //   return arrMemo.get(cacheKey)
  // }
  const length = endIdx - startIdx + 1
  if (arr.length === 0 || length === 0) {
    return memoAndReturn(-1)
  }
  if (length === 1) {
    return memoAndReturn(arr[startIdx] > min ? startIdx : -1)
  }
  if (length === 2) {
    for (let i = startIdx; i <= endIdx; i++) {
      if (arr[i] > min) {
        return memoAndReturn(i)
      }
    }
    return memoAndReturn(-1)
  }
  const midIdx = startIdx + Math.floor(length / 2)
  if (arr[midIdx] > min) {
    return find1stGtIdx(arr, min, startIdx, midIdx)
  } else {
    return find1stGtIdx(arr, min, midIdx + 1, endIdx)
  }

  function memoAndReturn(res) {
    // arrMemo.set(cacheKey, res)
    return res
  }
}

